import React, { useState, useEffect } from "react";
import "reactjs-popup/dist/index.css";
import Modal from "react-modal";
import * as myToast from "../../../Common/helper/toastHelper";
import "./style.css";
import * as productdetailApi from "../../apis/productdetail";

const customStyles = {
  content: {
    top: "45%",
    left: "80%",
    right: "auto",
    bottom: "auto",
    marginRight: "-50%",
    transform: "translate(-50%, -50%)",
  },
};

export default function FindProductModal(props) {
  const [timkiem, setTimkiem] = useState("");
  useEffect(() => {
    // Update the document title using the browser API
  });

  return (
    <Modal
      isOpen={props.showModal}
      onRequestClose={props.closeModal}
      style={customStyles}
      contentLabel="Example Modal"
    >
      <div class="add-item-modal timkiemsanpham-modal" role="document">
        <div class="">
          <div class="modal-header">
            <h5 class="modal-title" id="exampleModalLongTitle"></h5>
          </div>

          <div className="form-main-add-edit">
            <div className="row mb-3">
              <input
                className="form-control border"
                id="image"
                placeholder="Tìm kiếm sản phẩm"
                onChange={(e) => setTimkiem(e.target.value)}
              ></input>
            </div>

            <div className="list-product-data">
              <div className="modal-product-detail">
                <div className="image">
                  <img src="https://tinhocngoisao.cdn.vccloud.vn/wp-content/uploads/2021/11/FC_NZXT_Kraken_X53_RGB_BL-365x365.jpg" />
                </div>
                <div className="content">
                  <a
                    href="https://tinhocngoisao.com/tan-nhiet-cpu-nzxt-kraken-x53-black-rgb-aio-cooling-240-rl-krx53-r1"
                    target="_blank"
                  >
                    <p className="name">
                      {" "}
                      Tản nhiệt CPU NZXT Kraken X53 Black RGB AiO Cooling (240)
                      - RL-KRX53-R1{" "}
                    </p>
                    <p className="price"> Giá: 4,190,000 đ</p>
                    <p className="productid"> Mã sản phẩm: 166123 </p>
                  </a>
                  <button className="add-to-build" type="button">
                    Chọn
                  </button>
                </div>
              </div>
            </div>
          </div>

          <hr></hr>

          <div class="modal-footer">
            <button
              type="button"
              class="btn btn-secondary"
              data-dismiss="modal"
              onClick={props.closeModal}
            >
              Đóng
            </button>
            <button
              type="button"
              class="btn btn-primary"
            >
              Thêm
            </button>
          </div>
        </div>
      </div>
    </Modal>
  );
}
